import '../CSS/Menu.css';
import MenuItem from './MenuItem';

function Menu(props) {
     const database = props.database;

     return (
          <div className='menu_list'>
               {database.map((item) => (
                    <div>{MenuItem(item)}</div>
               ))}
          </div>
     );
}

export default Menu;
